class Solution {
  List<int> beautifulIndices(String s, String a, String b, int k) {
    List<int> results = [];
    for (int i = 0; i <= s.length - a.length; i++) {
      if (s.startsWith(a, i)) {
        bool found = false;
        for (int j = Math.max(0, i - k); j <= Math.min(s.length - b.length, i + k); j++) {
          if (s.startsWith(b, j)) {
            found = true;
            break;
          }
        }
        if (found) {
          results.add(i);
        }
      }
    }
    return results;
  }
}
